import React from 'react'
import Todo from './Todo'

export default function TodoList({ todoList, toggleTodo }) {
    return (
        // This loops over the array and returns a Todo object for each item
        todoList.map(todo => {
            return <Todo key={todo} todo={todo} toggleTodo={toggleTodo} />
        }
        )


    )
}
